import React from 'react';
import { NotesPage } from './pages';
import { ThemeProvider } from './context/ThemeContext';
import { SettingsProvider } from './context/SettingsContext';
import './App.css';

function App() {
  return (
    <div className="App">
      <ThemeProvider>
        <SettingsProvider>
          <NotesPage />
        </SettingsProvider>
      </ThemeProvider>
    </div>
  );
}

export default App;
